import React, { Component } from "react";
import styled from "styled-components";

const HEADER_HEIGHT = 200;



const Title = styled.h1`
  display: flex;
  color: black;
  justify-content: center;
  align-items: center;
  font-size: 1.5rem;
`;

const Span = styled.h1`
  padding: 5px;
  letter-spacing: 2px;
  font-size: 2rem;
`;

const Paragraph = styled.p`
  margin: 10px;
  display: block;
  position: relative;
  color: black;
  font-size: 1rem;
`;

const Logo = styled.img`
  display: block;
  width: 100%;
  box-shadow: -1px 0px 0px rgba(0, 0, 0, 0.06);
  object-fit: cover;
`;

const Container = styled.div`
  margin: 10px;
  display: grid;
  grid-template-columns: ${HEADER_HEIGHT}px repeat(auto-fit, minmax(10px, 1fr));
  height: ${HEADER_HEIGHT};
  justify-content: center;
  text-align: center;
  overflow: hidden;
  background-color: #666;
  color: white;
`;

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

export default class Header extends Component {
  render() {
    return (
    <Container>
        <Logo src={`https://picsum.photos/${HEADER_HEIGHT}`} />
        <Title>Bine ai venit pe <Span> edics.ro </Span></Title>
        <Paragraph>Solutii inteligente la problemele tale</Paragraph>
        </Container>
    );
  }
}
